import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Product from './product';

function Theke() {

  return (
    <div>
      <h2>Inhalt f√ºr Tab 2 hier</h2>
      <Row>
        <Col>
          <Product
            title="Produkt 1"
            imgSrc="holder.js/100px180"
            preis={2.50}
          />
        </Col>
        <Col>
          <Product
            title="Produkt 2"
            imgSrc="holder.js/100px180"
            preis={3.00}
          />
        </Col>
        <Col>
          <Product
            title="Produkt 3"
            imgSrc="holder.js/100px180"
            preis={1.50}
          />
        </Col>
        <Col>
          <Product
            title="Produkt 4"
            imgSrc="holder.js/100px180"
            preis={2.50}
          />
        </Col>
      </Row>
    </div>
  );
}

export default Theke;
